import React from "react";
import Certificate_1 from "./assets/certif-1.png";
import Certificate_2 from "./assets/certif-2.png";
import Certificate_3 from "./assets/certif-3.png";




const Certif=()=>{
    return(
      <>
      <div className="container">
      <img src={Certificate_1} className="certif" /> 
      <img src={Certificate_2} className="certif" /> 
      </div>

      <h1 className="certif-heading">Explore my linkedin for more!!</h1>

      <div className="container">
      <img src={Certificate_3} className="certif-2" /> 
      </div>

      </>
    );
}
export default Certif;
